import React from 'react';
import axios from 'axios';
import { useEffect, useState } from 'react';

const Home = () => {

  const [listofUsers, setListofUsers] = useState([]);

	useEffect(() => {
		axios.get('http://localhost:3001/Users').then((response) => {
			setListofUsers(response.data);
		});
	}, []);

	return (

    <div>


		<div className='wrapper3'>

<div className='dashboard'>
<ul>
  <li>Home</li>
  <li>Request</li>
  <li>Account</li>
  <li>Logout</li>
</ul>
</div>

<div className='content'>
  <table class="table">
    <thead>
      <tr>
        <th>No.</th>
        <th>Date</th>
        <th>Updated</th>
        <th>Request Type</th>
        <th>Client</th>
        <th>Status</th>
        <th>Priority</th>
        <th>Alert Level</th>
        <th>Tech</th>
      </tr>
    </thead>
    <tbody>
      <tr>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
      </tr>

    </tbody>
  </table>

  <div className='app'>
				{listofUsers.map((value, key) => {
					return (
						<div className='users'>
							<div className='fname'>{value.f_name}</div>
							<div className='mname'>{value.m_name}</div>
							<div className='lname'>{value.l_name}</div>
							<div className='contact'>{value.contact}</div>
							<div className='email'>{value.email}</div>
							<div className='username'>{value.username}</div>
							<div className='password'>{value.password}</div>
						</div>
					);
				})}
			</div>

</div>
    </div>

    </div>
	);
};

export default Home;
